// Addition Node Example
// THREE and TSL (Three.js Shading Language) namespaces are available!
// Enjoy! :)

// layout must be the first variable.

layout = {
	name: "RGBE Loader",
	width: 300,
	outputType: 'Texture',
	elements: [
		{ name: 'File', inputType: 'URL' }
	]
};

function loadFile() {

	const url = parameters.get( 'File' );

	async function load() {

		const { RGBELoader } = await import( 'three/addons/loaders/RGBELoader.js' );

		const loader = new RGBELoader();
		const hdrTexture = await loader.loadAsync( url );

		hdrTexture.mapping = THREE.EquirectangularReflectionMapping;

		local.set( url, hdrTexture );

		refresh();

	}

	load();

	return null;

}

function main() {

	const url = parameters.get( 'File' );
	const result = url ? local.get( url, loadFile ) : null;

	return result;

}

