		const loader = new GLTFLoader();
		loader.setDRACOLoader( dracoLoader );

		const model = await loader.loadAsync( url );

		local.set( url, model.scene );

		refresh();

	}

	load();

	return null;

}

function main() {

	const url = parameters.get( 'File' );
	const result = url ? local.get( url, loadFile ) : null;

	if ( result ) result.scale.setScalar( 3 );

	return result;

}

