layout = {
	name: "Replace Material By Name",
	width: 300,
	elements: [
		{ name: 'Source', inputType: 'Object3D' },
		{ name: 'Name', inputType: 'String' },
		{ name: 'Material', inputType: 'Material' }
	]
};

const origins = local.get( 'origins', () => [] );

function restore() {

	for ( const { mesh, material } of origins ) {

		mesh.material = material;

	}

	origins.length = 0;

}

function main() {

	const source = parameters.get( 'Source' );
	const name = parameters.get( 'Name' );
	const material = parameters.get( 'Material' );

	restore();

	if ( source === null ) return;

	const setMaterial = ( mesh, material ) => {

		origins.push( { mesh, material: mesh.material } );

		mesh.material = material;

	};

	if ( source.material && source.material.name === name ) {

		setMaterial( source, material );

	}

	source.traverse( ( obj ) => {

		if ( obj.material && obj.material.name === name ) {

			setMaterial( obj, material );

		}

	} );

}

