layout = {
	name: "Set Material",
	width: 300,
	elements: [
		{ name: 'Object', inputType: 'Object3D' },
		{ name: 'Material', inputType: 'Material' }
	]
};

function main() {

	const source = parameters.get( 'Object' );
	const material = parameters.get( 'Material' );

	if ( source === null ) return;

	if ( source.isGroup == true ) {

		for ( let mesh of source.children ) mesh.material = material || new THREE.MeshStandardMaterial();

	} else {

		source.material = material || new THREE.MeshStandardMaterial();

	}

}

