	name: "Set Position",
	width: 300,
	elements: [
		{ name: 'Object', inputType: 'Object3D' },
		{ name: 'Position', inputType: 'Vector3' }
	]
};

function main() {

	function setPosition( mesh, pos ) {

		mesh.position.x = ( pos ? pos.x ?? 0 : 0);
		mesh.position.y = ( pos ? pos.y ?? 0 : 0);
		mesh.position.z = ( pos ? pos.z ?? 0 : 0);

	}

	const source = parameters.get( 'Object' );
	const value = parameters.get( 'Position' );

	if ( source === null ) return;

	if ( source.isGroup == true ) {

		for ( let mesh of source.children ) setPosition( mesh, value );

	} else {

		setPosition( source, value )

	}

}

